window.bookSummaryJSON = "<p>Maddison James is about to discover some truths about the world.&nbsp;</p> <p>Firstly...supernaturals exist.</p> <p>WTF?&nbsp;</p> <p>Secondly...she is one, even though no one seems to know exactly what kind.</p> <p>Double WTF.</p> <p>Thirdly...she’s about to go back to school.</p> <p>Well, things just got a little more interesting.&nbsp;</p> <p>The Supernatural Academy is where shifters, vampires, magic users, and fey are educated. Where they are taught about their abilities, and how to function in the human world. Maddison already has the human part down, but this supernatural thing is an entirely new dangerous game.</p> <p>Example one: mean girls who can actually turn you into a frog.</p> <p>Example two: Asher Lock, a god at the Academy. Not literally...well, who knows for sure. He certainly acts the part, as do all of his minions who worship him.</p> <p>Asher drives her crazy, because apparently snarly, gorgeous, and arrogant is her thing, and despite their mutual dislike, sparks fly between them. The more they’re thrown together, the more Asher is determined to figure out what’s been blocking her abilities.</p> <p>Until the moment the truth is revealed, and they find out nothing in this supernatural world is what they thought.&nbsp;</p> <p>Including each other.</p>"; 
